import './App.css';
import Game from './components/Game';


function App() {
  return (
    <div className="App">
      <div class="grid-container">
        <div class="grid-x grid-padding-x">
          <div class="large-12 cell">
            <Game />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
